import React from "react";
import "../../Styling/LandingPage/menu.css";
import "../../Styling/LandingPage/style.css";
// import logo from "../../Images/star.png";
import { TweenLite, TimelineMax, TimelineLite, Linear, Back, Sine } from "gsap";

class LandingPage extends React.Component {
  constructor(props) {
    super(props);
    this.myElement = null;
    this.myTween = TimelineLite({ paused: true });
  }

  componentDidMount() {
    this.myTween
      .to(this.myElement, 0.5, { x: 100 })
      .to(this.myElement, 0.5, { y: 100, rotation: 180 })
      .play();
  }

  render() {
    return (
      <div className="page-body">
        <header className="showcase">
          <div className="container showcase-inner">
            <h1>Welcome to Wunder</h1>
            <p className="lets">Let's Eat!</p>
            <a href="/main" className="landingPage-btn">
              Enter
            </a>
          </div>
        </header>
      </div>
    );
  }
}

export default LandingPage;
